// Fun√ß√£o para converter string JSON em array
function parseArray(str) {
  try {
    const arr = typeof str === "string" ? JSON.parse(str) : str;
    return Array.isArray(arr) ? arr : [];
  } catch {
    return [];
  }
}

// Fun√ß√£o para enumerar objetos e transformar tudo em 1 objeto dentro de um array
function enumerateObjects(array, fields) {
  const obj = {};

  array.forEach((entry, index) => {
    const i = index + 1;
    fields.forEach(f => {
      obj[`${f}${i}`] = entry[f] ?? "";
    });
  });

  return [obj];
}

